import React from 'react'

function Header() {
    return (
        <div className="header">
            <img className="header__logo" src="https://www.google.com/search?q=amazon+logo&sxsrf=ALeKk034ZX9P6jnBGf2QrLgwhmQmRjx2eA:1599398191639&tbm=isch&source=iu&ictx=1&fir=h5KdYjHdvPGW3M%252C1tsac6mCmjn-EM%252C_&vet=1&usg=AI4_-kSVASGeFl-Nsa0CfMwB2FeO4ZTzoA&sa=X&ved=2ahUKEwjBosTIztTrAhUxzzgGHTWLCHEQ9QF6BAgKEGg&biw=1309&bih=725#imgrc=_PzI2spokBJvXM" alt="logo" ></img>
        </div>
    )
}

export default Header
